import React from 'react'

const Work = ()=>{
    return(
        <>
        <div>
            <h4>Blocked Apps - count</h4>
            {/* maps the array of blocked apps here */}
            <p>facebook</p>
            <p>twitter</p>
            <p>youtube</p>
            <p>abcd</p>

        </div>
        <div>
            <h4>Other Installed apps</h4>
        </div>

        </>

    )
}

export default Work;
